import { Link } from "react-router-dom";

const EventsPage = () => {
  return (
    <>
      <h1>Events page</h1>
      <ul>
        <li>
          <Link>Event 1</Link>
        </li>
        <li>Event 2</li>
        <li>Event 3</li>
      </ul>
    </>
  );
};

export default EventsPage;
